import React from 'react';

export default function Header()
{
    return(
        <header className="header">
        <h1 className="header--title">Kite</h1>
        <img src="kite\src\images\user_icon.jpg" alt=""/>
        <img 
            src="https://pngimg.com/uploads/trollface/trollface_PNG15.png" alt=""
            className="headerimg"/>
        </header>
    )
}
